            $(function() {

<style type="text/css">
body {
  width: 100%;
} 


.container {
  margin: 0;
  width: 100%;
  display: inline-grid;
  grid-template-columns:
  1fr 1fr 1fr 1fr 1fr 
  1fr 1fr 1fr 1fr 1fr 
  1fr 1fr 1fr 1fr 1fr 
  1fr 1fr 1fr 1fr 1fr 
  1fr 1fr 1fr 1fr 1fr
  1fr 1fr 1fr 1fr 1fr 
  1fr 1fr 1fr 1fr 1fr 
  1fr 1fr 1fr 1fr 1fr 
  1fr 1fr 1fr 1fr 1fr 
  1fr 1fr 1fr 1fr ;

  grid-gap: 0px;
}

.container a {
  width: auto;
  aspect-ratio : 1 / 1;
  display: flex;
  flex-direction: column;
}

.external a { 
  position: relative;
  display: inline-block;
  border-bottom: 1px dotted black;
}

.external .tooltipimage {
  visibility: hidden;
  padding: 5px 0;
  border-radius: 6px;
  position: absolute;
  z-index: 1;
}

.external .tooltipimage img{
  width: 400px;
}

.external:hover .tooltipimage {
  visibility: visible;
}

a:visted {
  background color: black;

}

</style>

</head>
